window.bookSummaryJSON = "<p>My history is unknown....&nbsp;&nbsp;&nbsp;</p> <p>My present is violent....&nbsp;&nbsp;&nbsp;</p> <p>My future may be more dangerous still. <br> I use my unique skillset in one of the Moon’s many watering holes.&nbsp;&nbsp;</p> <p>Here, miners can spend their hard-earned money to forget that they’re not among the wealthy elite in the paradise colony on Mars.&nbsp;&nbsp;&nbsp;</p> <p>When a known crime boss walks in, events will begin to unfold hinting at a dark past and an even murkier future.&nbsp;&nbsp;</p> <p>Think <i>Roadhouse</i> meets <i>Total Recall</i> and you’re halfway there.</p>"; 
